import React, { useState } from 'react';
import '../../App.css';
import {BrowserRouter, Link, Route, Switch} from 'react-router-dom';
import AuthenticationService from './AuthenticationService.js';
import HeaderComponent from './HeaderComponent';
import AuthenticatedRoute from './AuthenticatedRoute.jsx';
import LoginComponent from './LoginComponent.jsx';
import ListTodoComponent from './ListTodoComponent.jsx';

function TodoApp() {

    return (
        <div className="App">
            <BrowserRouter>
                <HeaderComponent/>
                <Switch>
                    <Route path="/" exact component={LoginComponent}/>
                    <Route path="/login" component={LoginComponent}/>
                    <AuthenticatedRoute path="/welcome/:name" component={WelcomeComponent}/>
                    <AuthenticatedRoute path="/todos" component={ListTodoComponent}/>
                    <AuthenticatedRoute path="/logout" component={LogoutComponent}/>
                    <Route component={ErrorComonent}/>
                </Switch>
                <FooterComponent/>
            </BrowserRouter>
        </div>

    )
}


function LogoutComponent(){
    return(
        <div>
            <h1>You are logout</h1>
            <div className="container">
                Thank you for using our application.
            </div>
        </div>
    )
}

function FooterComponent(){
    return(
        <footer className="footer">
            <span className="text-muted">All Rights Reserved 2021 @jacky</span>
        </footer>
    )
}



function WelcomeComponent(props){
    return (
        <div>
            <h1>Welcome!</h1>
            <div className="container">
                <p>Welcome to {props.match.params.name}'s world</p>
                <p>You can manage your todos <Link to="/todos">here</Link></p>
            </div>
        </div>
    );
}

function ErrorComonent(){
    return(
        <div>An Error Occurred.</div>
    )
}



export default TodoApp;
